#include <gtest/gtest.h>
#include <string>

#include "Hackerrank/substr_count.h"

TEST(Hackerrank, substr_count_Test) {
  std::string s0 = "abcbaba";
  std::string s1 = "aaaa";
  std::string s2 = "asasd";
  std::string s3 = "";
  std::string s4 = "mnonopoo";
  std::string s5 = "aaabbc";
  std::string s6 = "";

  EXPECT_EQ(Hackerrank::substrCount(7, s0), 10);
  EXPECT_EQ(Hackerrank::substrCount(4, s1), 10);
  EXPECT_EQ(Hackerrank::substrCount(5, s2), 7);
  EXPECT_EQ(Hackerrank::substrCount(55269, s3), 66516);
  EXPECT_EQ(Hackerrank::substrCount(8, s4), 12);
  EXPECT_EQ(Hackerrank::substrCount(8, s4), 12);
  EXPECT_EQ(Hackerrank::substrCount(6, s5), 10);
  EXPECT_EQ(Hackerrank::substrCount(65476, s6), 152076);
}